}

function slice${cd}(
  bytes ${cd ? "calldata" : "memory"} encoded,
  uint offset,
  uint length
) internal pure returns (bytes memory ret, uint nextOffset) {
  (ret, nextOffset) = slice${cd}Unchecked(encoded, offset, length);
